			while(true) do
				curCol = curCol + 1
				if (curCol > numCols) then break end
				if (col == 0 or col == curCol) then
					mbitem = MultiboardGetItem(mb, curRow - 1, curCol - 1)
					if (mbitem ~= nil) then
						MultiboardSetItemIcon(mbitem, iconFileName)
						MultiboardReleaseItem(mbitem)
					end
				end
			end
		end
	end
	mbitem = nil
end

