function A_V (A0V)
	local A3V = TimerGetElapsed(C8) ---@type number real
	local A2V ---@type number real
	if A3V <= 0. then
		C8 = CreateTimer()
		TimerStart(C8, 1000000., false, nil)
	end
	if A0V > 0. then
		while(true) do
			A2V = A0V - TimerGetElapsed(C8) + A3V
			if (A2V <= 0.) then break end
			if A2V > bj_POLLED_WAIT_SKIP_THRESHOLD then
				TriggerSleepAction(.1 * A2V)
			else
				TriggerSleepAction(bj_POLLED_WAIT_INTERVAL)
			end
		end
	end
end

