---@param g_1 group
---@param plus_by_one number real
---@param max number integer
function Change_Unit_Max_HP_Based_On_Group_Count (g_1, plus_by_one, max)
	local ut ---@type unit
	local baseHP ---@type number real
	local group_units_count ---@type number integer
	group_units_count = CountUnitsInGroup(g_1)
	ut = FirstOfGroup(g_1)
	baseHP = GetUnitState(ut, UNIT_STATE_MAX_LIFE)
	if group_units_count > max then
		group_units_count = max
	end
	while(true) do
		ut = FirstOfGroup(g_1)
		SetUnitMaxLife(ut, baseHP + (plus_by_one * group_units_count))
		SetUnitState(ut, UNIT_STATE_LIFE, baseHP + (plus_by_one * group_units_count))
		GroupRemoveUnit(g_1, ut)
		if (ut == nil) then break end
	end
	ut = nil
end

---@param g_1 group
---@param plus_by_one number integer
---@param max number integer
function Change_Unit_Base_Damage_Based_On_Group_Count (g_1, plus_by_one, max)
	local ut ---@type unit
	local base_DMG ---@type number real
	local l_g_1 ---@type group
	local group_units_count ---@type number integer
	l_g_1 = g_1
	group_units_count = CountUnitsInGroup(l_g_1)
	ut = FirstOfGroup(l_g_1)
	base_DMG = GetUnitBaseDamage(ut)
	if group_units_count > max then
		group_units_count = max
	end
	while(true) do
		ut = FirstOfGroup(l_g_1)
		SetUnitBaseDamage(ut, R2I(base_DMG + I2R(plus_by_one * group_units_count)))
		GroupRemoveUnit(l_g_1, ut)
		if (ut == nil) then break end
	end
	ut = nil
	DestroyGroup(l_g_1)
	l_g_1 = nil
end

