end

---@param this string
---@return number integer
function string_getHash (this)
	return StringHash(this)
end

---@param msg string
---@param w__wurst_stackPos string
function error (msg, w__wurst_stackPos)
	local hash ---@type number integer
	local stacktraceStr ---@type string
	local stacktraceIndex ---@type number integer
	local stacktraceLimit ---@type number integer
	local stacktraceStr_1 ---@type string
	local stacktraceIndex_1 ---@type number integer
	local stacktraceLimit_1 ---@type number integer
	local temp ---@type string
	local temp_1 ---@type string
	wurst_stack[wurst_stack_depth] = w__wurst_stackPos
	wurst_stack_depth = wurst_stack_depth + 1
	if MagicFunctions_compiletime then
		compileError("ERROR: " .. msg)
	else
		if not ErrorHandling_suppressErrorMessages then
			hash = string_getHash(msg)
			if hashtable_hasInt(ErrorHandling_HT, ErrorHandling_PRIMARY_ERROR_KEY, hash) then
				if hashtable_loadInt(ErrorHandling_HT, ErrorHandling_PRIMARY_ERROR_KEY, hash) + ErrorHandling_MUTE_ERROR_DURATION < GameTimer_currentTime then
					temp = msg
					stacktraceStr = ""
					stacktraceIndex = wurst_stack_depth
					stacktraceLimit = 0
					while(true) do
						stacktraceIndex = stacktraceIndex - 1
						stacktraceLimit = stacktraceLimit + 1
						if (stacktraceLimit > 20) then break end
						if (stacktraceIndex < 0) then break end
						stacktraceStr = stacktraceStr .. "\n " .. wurst_stack[stacktraceIndex]
					end
					Log_error(temp .. stacktraceStr)
					hashtable_saveInt(ErrorHandling_HT, ErrorHandling_PRIMARY_ERROR_KEY, hash, R2I(GameTimer_currentTime))
					hashtable_saveBoolean(ErrorHandling_HT, ErrorHandling_PRIMARY_ERROR_KEY, hash, false)
				elseif hashtable_loadInt(ErrorHandling_HT, ErrorHandling_PRIMARY_ERROR_KEY, hash) + ErrorHandling_MUTE_ERROR_DURATION < GameTimer_currentTime then
					if not hashtable_loadBoolean(ErrorHandling_HT, ErrorHandling_PRIMARY_ERROR_KEY, hash) then
						Log_error("|cffFF3A29Excessive repeating errors are being omitted")
						hashtable_saveBoolean(ErrorHandling_HT, ErrorHandling_PRIMARY_ERROR_KEY, hash, true)
					end
				else
					Log_error("|cffFF3A29Excessive repeating errors are being omitted")
					hashtable_saveBoolean(ErrorHandling_HT, ErrorHandling_PRIMARY_ERROR_KEY, hash, true)
				end
			else
				hashtable_saveInt(ErrorHandling_HT, ErrorHandling_PRIMARY_ERROR_KEY, hash, R2I(GameTimer_currentTime))
				temp_1 = "Message: " .. msg
				stacktraceStr_1 = ""
				stacktraceIndex_1 = wurst_stack_depth
				stacktraceLimit_1 = 0
				while(true) do
					stacktraceIndex_1 = stacktraceIndex_1 - 1
					stacktraceLimit_1 = stacktraceLimit_1 + 1
					if (stacktraceLimit_1 > 20) then break end
					if (stacktraceIndex_1 < 0) then break end
					stacktraceStr_1 = stacktraceStr_1 .. "\n " .. wurst_stack[stacktraceIndex_1]
				end
				Log_error(temp_1 .. stacktraceStr_1)
			end
		end
		I2S(1 / 0)
	end
	wurst_stack_depth = wurst_stack_depth - 1
end

---@param playerID number integer
---@param myInteger number integer
---@param unitID number integer
function FindPlayerInMultiboardAndUpdateIcon (playerID, myInteger, unitID)
	local columnIndex = 1 ---@type number integer
	local iter = 1 ---@type number integer
	while(true) do
		if (iter > MultiboardGetRowCount(JR) - 4) then break end
		if PlayerIdsInBord[iter] == playerID then
			MultiboardSetItemIconBJ(JR, unitID + 6, iter, "war3mapImported\\" .. UnitId2String(myInteger) .. ".blp")
		end
		iter = iter + 1
	end
end

---@param myPlayer player
function ReRollNah (myPlayer)
	local mirrorPlayer ---@type player
	local playerID = GetPlayerId(myPlayer) ---@type number integer
	local mirrorPlayerID = 0 ---@type number integer
	local unitID = 0 ---@type number integer
	local myInteger = 0 ---@type number integer
	local tierIndex ---@type number integer
	local unitsPerTier = 1 ---@type number integer
	local unitCounter = 1 ---@type number integer
	mirrorPlayerID = ModuloInteger((playerID + 4), 8)
	mirrorPlayer = Player(mirrorPlayerID)
	SetPlayerTechMaxAllowedSwap($52303049, 0, GetEnumPlayer())
	SetPlayerTechMaxAllowedSwap($68304138, 0, myPlayer)
	while(true) do
		if (unitID > 5) then break end
		unitsPerTier = 1
		unitCounter = 1
		while(true) do
			if RolledUnits[unitID + playerID * 6] ~= unitCounter then
				tierIndex[unitsPerTier] = unitCounter
				unitsPerTier = unitsPerTier + 1
			end
			unitCounter = unitCounter + 1
			if (unitCounter > PB[unitID + 1]) then break end
		end
		unitCounter = GetRandomInt(1, unitsPerTier - 1)
		unitsPerTier = tierIndex[unitCounter]
		RolledUnits[unitID + playerID * 6] = unitsPerTier
		if modeMI then
			RolledUnits[unitID + (ModuloInteger(playerID, 4)) * 6] = unitsPerTier
