			elseif unitID == 0 then
				myInteger = SB[unitCounter]
			elseif unitID == 0 then
				myInteger = TB[unitCounter]
			elseif unitID == 0 then
				myInteger = UB[unitCounter]
			elseif unitID == 0 then
				myInteger = WB[unitCounter]
			end
			if unitCounter == unitsPerTier then
				SetPlayerTechMaxAllowedSwap(myInteger, -1, myPlayer)
				if modeMI then
					SetPlayerTechMaxAllowedSwap(myInteger, -1, mirrorPlayer)
