				end
				if modeMI then
					if VisualPick[mirrorPlayerID * 6 + unitID] ~= nil then
						ShowImage(VisualPick[mirrorPlayerID * 6 + unitID], false)
						DestroyImage(VisualPick[mirrorPlayerID * 6 + unitID])
					end
				end
				VisualPick[playerID * 6 + unitID] = CreateImage("war3mapImported\\" .. UnitId2String(myInteger) .. ".blp", 104., 104., 0., VisualPickXY[playerID * 2] + 104 * unitID, VisualPickXY[playerID * 2 + 1], 256., 0., 0., 0., 3)
				if IsPlayerInForce(myPlayer, ZI) then
					FindPlayerInMultiboardAndUpdateIcon(playerID, myInteger, unitID)
				end
				if modeMI then
					VisualPick[mirrorPlayerID * 6 + unitID] = CreateImage("war3mapImported\\" .. UnitId2String(myInteger) .. ".blp", 104., 104., 0., VisualPickXY[mirrorPlayerID * 2] + 104 * unitID, VisualPickXY[mirrorPlayerID * 2 + 1], 256., 0., 0., 0., 3)
					if IsPlayerInForce(myPlayer, ZI) then
						FindPlayerInMultiboardAndUpdateIcon(mirrorPlayerID, myInteger, unitID)
					end
				end
				SetImageRenderAlways(VisualPick[playerID * 6 + unitID], true)
				if modeMI then
