function DFX ()
	local x_1 ---@type number real
	local y_1 ---@type number real
	if GetUnitManaPercent(GetEnumUnit()) == 100. and BB[GetUnitUserData(GetEnumUnit())] == false then
		x_1 = GetUnitX(GetEnumUnit())
		y_1 = GetUnitY(GetEnumUnit())
		NA = IHE(350., x_1, y_1, Condition(ref_function_DDX))
		if CountUnitsInGroup(NA) > 0 then
			PE = GroupPickRandomUnit(NA)
			BB[GetUnitUserData(GetEnumUnit())] = true
			UnitAddAbility(GetEnumUnit(), $41303536)
			IssueTargetOrderById(GetEnumUnit(), 852106, PE)
		end
		A4V(NA)
	elseif GetUnitManaPercent(GetEnumUnit()) == 100. and BB[GetUnitUserData(GetEnumUnit())] == false then
		UnitRemoveAbility(GetEnumUnit(), $41303536)
	end
end

