---@param p player
---@param count number integer
function CreateIncomeTexttag (p, count)
	local i_1 = GetPlayerId(p) ---@type number integer
	local f ---@type force
	local f2 ---@type force
	local text ---@type string
	local tt ---@type location
	if i_1 / 4 == 1 then
		RIncomeCounter = RIncomeCounter + count
		f = EastForce
		f2 = WestForceWithoutObs
		text = "|cff339933 " .. I2S(RIncomeCounter) .. "|r"
		tt = RIncomeTexttagLoc
	else
		LIncomeCounter = LIncomeCounter + count
		f = WestForce
		f2 = EastForceWithoutObs
		text = "|cff339933 " .. I2S(LIncomeCounter) .. "|r"
		tt = LIncomeTexttagLoc
	end
	DestroyTextTag(IncomeTexttag[i_1 / 4 + 1])
	IncomeTexttag[i_1 / 4 + 1] = CreateTextTagLocBJ(text, tt, 0., 17.5, 255., 255., 255., 0.)
	SetTextTagPermanentBJ(IncomeTexttag[i_1 / 4 + 1], true)
	ShowTextTagForceBJ(true, IncomeTexttag[i_1 / 4 + 1], f)
	ShowTextTagForceBJ(false, IncomeTexttag[i_1 / 4 + 1], f2)
	f = nil
	f2 = nil
	tt = nil
	f = nil
	f2 = nil
	tt = nil
end

