function NBV ()
	local t = GetTriggeringTrigger() ---@type trigger
	local h = GetHandleId(t) ---@type number integer
	local u_1 = LoadUnitHandle(HY, h, 17) ---@type unit
	local NCV = LoadInteger(HY, h, 59) ---@type number integer
	local NDV = LoadInteger(HY, h, 60) ---@type number integer
	local tt = LoadTimerHandle(HY, h, 10) ---@type timer
	SaveBoolean(HY, h, 0, true)
	UnitRemoveAbility(u_1, NDV)
	UnitRemoveAbility(u_1, NCV)
	if GetUnitAbilityLevel(u_1, NCV) == 0 then
		FlushChildHashtable(HY, h)
		DestroyTrigger(t)
		DestroyTimer(tt)
		tt = nil
		RemoveSavedHandle(X, GetHandleId(u_1), 0 - NCV)
	else
		TimerStart(tt, 1., true, nil)
	end
	u_1 = nil
	t = nil
	t = nil
	u_1 = nil
	tt = nil
	return false
end

---@param r rect
---@param id_1 number integer
---@param NCE number integer
function NBE (r, id_1, NCE)
	local h = GetHandleId(r) ---@type number integer
	local NDE = LoadReal(HY, h, 0) ---@type number real
	local NGE = LoadReal(HY, h, 1) ---@type number real
	local NHE = LoadReal(HY, h, 2) ---@type number real
	local NJE = LoadReal(HY, h, 3) ---@type number real
	local u_1 ---@type unit
	local x_1 ---@type number real
	local y_1 ---@type number real
	local p ---@type player
	local NPE ---@type number integer
	if NCE < 5 then
		NPE = 1
	else
		NPE = 2
	end
	if NCE < 3 then
		p = Player(10)
	end
	if NCE >= 3 and NCE < 5 then
		p = Player(14)
	end
	if NCE >= 5 and NCE < 7 then
		p = Player(11)
	end
	if NCE >= 7 and NCE < 9 then
		p = Player(15)
	end
	if NDE == NHE then
		NDE = GetRectMinX(r)
		NHE = GetRectMaxX(r)
		NGE = GetRectMinY(r)
		NJE = GetRectMaxY(r)
		SaveReal(HY, h, 0, NDE)
		SaveReal(HY, h, 1, NGE)
		SaveReal(HY, h, 2, NDE)
		SaveReal(HY, h, 3, NGE)
	end
	x_1 = GetRandomReal(NDE, NHE)
	y_1 = GetRandomReal(NGE, NJE)
	u_1 = CreateUnit(p, id_1, x_1, y_1, 90.)
	SetUnitUserData(u_1, NCE)
	GroupAddUnit(XA, u_1)
	GroupAddUnit(MA[NPE], u_1)
	GroupAddUnit(IG[NCE], u_1)
	IssuePointOrderByIdLoc(u_1, 851983, CO[NCE])
	u_1 = nil
