---@param r number integer
---@param g number integer
---@param b number integer
function TextUp (s, u, size, r, g, b)
	local x1 = 0.0355 * Cos(90. * bj_DEGTORAD) ---@type number real
	local y1 = 0.0355 * Sin(90. * bj_DEGTORAD) ---@type number real
	bj_lastCreatedTextTag = CreateTextTag()
	SetTextTagText(bj_lastCreatedTextTag, s, (size * 0.023) / 10)
	SetTextTagPosUnit(bj_lastCreatedTextTag, u, 7)
	SetTextTagColor(bj_lastCreatedTextTag, r, g, b, 0)
	SetTextTagVelocity(bj_lastCreatedTextTag, x1, y1)
	SetTextTagPermanent(bj_lastCreatedTextTag, false)
	SetTextTagLifespan(bj_lastCreatedTextTag, 2.5)
	SetTextTagFadepoint(bj_lastCreatedTextTag, 0)
end

function TimeAbility ()
	local NVE ---@type unit
	local u1 ---@type unit
	local u2 ---@type unit
	local t ---@type timer
	local IQE ---@type number integer
	local x_1 ---@type number real
	local y_1 ---@type number real
	t = GetExpiredTimer()
	u1 = LoadUnitHandle(Hash, GetHandleId(t), FourCC('Targ'))
	u2 = LoadUnitHandle(Hash, GetHandleId(t), FourCC('Unit'))
	NVE = LoadUnitHandle(Hash, GetHandleId(t), FourCC('Dumm'))
	x_1 = GetUnitX(u2)
	y_1 = GetUnitY(u2)
	if GetUnitAbilityLevel(u1, FourCC('A3HQ')) == 1 then
		UnitRemoveAbility(u1, FourCC('A3HQ'))
		SetUnitArmor(u1, GetUnitArmor(u1) + 5.0)
	end
	if GetUnitAbilityLevel(u1, FourCC('A4HQ')) == 1 then
		UnitRemoveAbility(u1, FourCC('A4HQ'))
		SetUnitArmor(u1, GetUnitArmor(u1) + 4.0)
	end
	if GetUnitAbilityLevel(u1, FourCC('A5HQ')) == 1 then
		UnitRemoveAbility(u1, FourCC('A5HQ'))
		SetUnitArmor(u1, GetUnitArmor(u1) + 4.0)
	end
	if GetUnitAbilityLevel(u1, FourCC('T14R')) == 1 then
		UnitRemoveAbility(u1, FourCC('T14R'))
	end
	if GetUnitTypeId(u2) == FourCC('h0GA') then
		IssueTargetOrder(u2, "attack", u1)
	end
	if GetUnitTypeId(u2) == FourCC('h02H') then
		IssueImmediateOrderById(NVE, 852526)
		UnitApplyTimedLife(NVE, $42544C46, 1.)
	end
	if GetUnitTypeId(u2) == FourCC('h02F') then
		IssueImmediateOrderById(NVE, 852526)
		UnitApplyTimedLife(NVE, $42544C46, 1.)
	end
	if GetUnitTypeId(u2) == FourCC('h04N') then
		IQE = R2I(GetUnitState(u2, UNIT_STATE_MANA) / 3 * 2)
		UnitDamageTargetBJ(u2, u1, I2R(IQE), ATTACK_TYPE_MAGIC, DAMAGE_TYPE_NORMAL)
		SetUnitState(u2, UNIT_STATE_MANA, GetUnitState(u2, UNIT_STATE_MANA) - 20)
		TextUp(I2S(IQE), u2, 10, 0, 0, 255)
		IQE = IQE + GetRandomInt(193, 205)
		I2S(IQE)
		GetUnitFlyHeight(u2)
	end
	if GetUnitTypeId(u2) == FourCC('h0J8') and GetUnitAbilityLevel(u2, FourCC('Avul')) == 1 then
		UnitAddAbility(u2, FourCC('Avul'))
		UnitRemoveAbility(u2, FourCC('Avul'))
	end
	if GetUnitTypeId(u2) == FourCC('h166') then
		if GetUnitAbilityLevel(u1, FourCC('A04Y')) == 1 or GetUnitAbilityLevel(u1, FourCC('A933')) == 1 then
			if GetUnitLifePercent(u1) > 2. then
				QO = GetUnitLifePercent(u1) - 0.5
				if QO < 0.5 then
					QO = 0.5
				end
				SetUnitLifePercentBJ(u1, QO)
				if GetRandomInt(1, 4) == 1 then
					SetUnitLifeBJ(u2, (GetUnitStateSwap(UNIT_STATE_LIFE, u2) + (GetUnitStateSwap(UNIT_STATE_LIFE, u1) * 0.008)))
					DestroyEffect(AddSpecialEffect("Abilities\\Spells\\Items\\TomeOfRetraining\\TomeOfRetrainingCaster.mdl", x_1, y_1))
				end
			end
		else
			if GetUnitLifePercent(u1) > 4. then
				QO = GetUnitLifePercent(u1) - 2.0
				if QO < 1. then
					QO = 1.
				end
				SetUnitLifePercentBJ(u1, QO)
				if GetRandomInt(1, 4) == 1 then
					SetUnitLifeBJ(u2, (GetUnitStateSwap(UNIT_STATE_LIFE, u2) + (GetUnitStateSwap(UNIT_STATE_LIFE, u1) * 0.03)))
					DestroyEffect(AddSpecialEffect("Abilities\\Spells\\Items\\AIre\\AIreTarget.mdl", x_1, y_1))
				end
			end
		end
	end
	if GetUnitTypeId(u2) == FourCC('h0CD') then
		UnitRemoveAbility(u2, FourCC('A166'))
		UnitRemoveAbility(u2, FourCC('A167'))
	end
	if GetUnitAbilityLevel(u2, FourCC('A06P')) == 1 then
		UnitRemoveAbility(u2, FourCC('A11U'))
	end
	if GetUnitTypeId(u2) == FourCC('h0FQ') then
		UnitRemoveAbility(u2, FourCC('A75T'))
	end
	FlushChildHashtable(Hash, GetHandleId(t))
	PauseTimer(t)
	DestroyTimer(t)
	NVE = nil
	u1 = nil
	u2 = nil
	t = nil
end

