---@param NEW_Barrack1 number integer
---@param NEW_Barrack2 number integer
---@param NEW_Barrack3 number integer
---@param Check_Income number integer
function Change_ALL_Barracks (NEW_Barrack1, NEW_Barrack2, NEW_Barrack3, Check_Income)
	local cycle_index = 1 ---@type number integer
	if NEW_Barrack1 ~= 0 then
		while(true) do
			if (cycle_index > 8) then break end
			if Check_Income == 0 then
				ReplaceUnitBJ_FIX(WC[cycle_index], NEW_Barrack1, 1)
				WC[cycle_index] = bj_lastReplacedUnit
			else
				if BI[cycle_index] >= 360 then
					ReplaceUnitBJ_FIX(WC[cycle_index], NEW_Barrack1, 1)
					WC[cycle_index] = bj_lastReplacedUnit
				end
			end
			cycle_index = cycle_index + 1
		end
	end
	cycle_index = 1
	if NEW_Barrack2 ~= 0 then
		while(true) do
			if (cycle_index > 8) then break end
			if Check_Income == 0 then
				ReplaceUnitBJ_FIX(WWQ[cycle_index], NEW_Barrack2, 1)
				WWQ[cycle_index] = bj_lastReplacedUnit
			else
				if BI[cycle_index] >= 360 then
					ReplaceUnitBJ_FIX(WWQ[cycle_index], NEW_Barrack2, 1)
					WWQ[cycle_index] = bj_lastReplacedUnit
				end
			end
			cycle_index = cycle_index + 1
		end
	end
	cycle_index = 1
	if NEW_Barrack3 ~= 0 then
		while(true) do
			if (cycle_index > 8) then break end
			if Check_Income == 0 then
				ReplaceUnitBJ_FIX(WWC[cycle_index], NEW_Barrack3, 1)
				WWC[cycle_index] = bj_lastReplacedUnit
			else
				if BI[cycle_index] >= 360 then
					ReplaceUnitBJ_FIX(WWC[cycle_index], NEW_Barrack3, 1)
					WWC[cycle_index] = bj_lastReplacedUnit
				end
			end
			cycle_index = cycle_index + 1
		end
	end
	cycle_index = 1
end

function ChangeBarrackTime ()
	local t ---@type timer
	t = GetExpiredTimer()
	if Now_Level == 9 then
		Change_ALL_Barracks(FourCC('h05D'), FourCC('h25D'), 0, 0)
	end
	if Now_Level == 11 then
		Change_ALL_Barracks(FourCC('h0AZ'), FourCC('h2AZ'), 0, 0)
	end
	if Now_Level == 19 then
		Change_ALL_Barracks(FourCC('h05D'), FourCC('h25D'), FourCC('h35D'), 0)
	end
	PauseTimer(t)
	DestroyTimer(t)
	t = nil
end

function After_Wave_Change_Barrack_and_King_States ()
	local t ---@type timer
	if Now_Level < 5 then
		Change_King_Abilities_level(1)
	end
	if Now_Level >= 5 and Now_Level <= 6 then
		Change_King_Abilities_level(2)
	end
	if Now_Level >= 7 and Now_Level <= 12 then
		Change_King_Abilities_level(3)
	end
	if Now_Level >= 13 and Now_Level <= 16 then
		Change_King_Abilities_level(4)
	end
	if Now_Level >= 17 then
		Change_King_Abilities_level(5)
	end
	if Now_Level == 6 then
		Change_ALL_Barracks(FourCC('h0D9'), FourCC('h2D9'), 0, 0)
	end
	if Now_Level == 9 then
		t = CreateTimer()
		TimerStart(t, 6, false, ChangeBarrackTime)
	end
	if Now_Level == 10 then
		Change_ALL_Barracks(FourCC('h0B0'), FourCC('h2B0'), 0, 0)
	end
	if Now_Level == 11 then
		t = CreateTimer()
		TimerStart(t, 6, false, ChangeBarrackTime)
	end
	if Now_Level > 12 and Now_Level ~= 20 and Now_Level ~= 16 then
		Change_ALL_Barracks(FourCC('h0B0'), FourCC('h2B0'), FourCC('h45D'), 1)
	end
	if Now_Level == 19 then
		t = CreateTimer()
		TimerStart(t, 6, false, ChangeBarrackTime)
	end
	t = nil
end

