function PZE ()
	local player_id = GetUnitUserData(GetEnumUnit()) - 1 ---@type number integer
	local iter = 0 ---@type number integer
	local randi = 0 ---@type number integer
	local zapas = 4 ---@type number integer
	if GetPlayerSlotState(Player(player_id + 4)) == PLAYER_SLOT_STATE_PLAYING then
		player_id = player_id + 4
	else
		while(true) do
			randi = GetRandomInt(0, 3)
			if GetPlayerSlotState(Player(randi + 4)) == PLAYER_SLOT_STATE_PLAYING then
				zapas = randi + 4
				iter = 15
			end
			iter = iter + 1
			if (iter > 15) then break end
		end
		player_id = zapas
