	end
	SetUnitPositionLoc(GetEnumUnit(), EN[1 + player_id])
	GroupAddUnit(XA, GetEnumUnit())
	GroupAddUnit(MA[2], GetEnumUnit())
	GroupAddUnit(IG[1 + player_id], GetEnumUnit())
	IssuePointOrderByIdLoc(GetEnumUnit(), 851983, CO[1 + player_id])
end

