---@param u_1 unit
---@param id_1 number integer
---@param NAV number integer
function NIV (u_1, id_1, NAV)
	if GetUnitAbilityLevel(u_1, id_1) == 0 then
		UnitAddAbility(u_1, id_1)
		UnitMakeAbilityPermanent(u_1, true, id_1)
	end
	SetUnitAbilityLevel(u_1, id_1, NAV)
end

---@param u_1 unit
---@param NCV number integer
---@param NAV number integer
---@param NJV number real
---@param NDV number integer
function NFV (u_1, NCV, NAV, NJV, NDV)
	local t ---@type trigger
	local h ---@type number integer
	local NKV ---@type number real
	local tt ---@type timer
	if NVV(u_1) then
		t = nil
		tt = nil
		return
	end
	if HaveSavedHandle(X, GetHandleId(u_1), 0 - NCV) then
		t = LoadTriggerHandle(X, GetHandleId(u_1), 0 - NCV)
		h = GetHandleId(t)
		tt = LoadTimerHandle(HY, h, 10)
	else
		t = CreateTrigger()
		h = GetHandleId(t)
		tt = CreateTimer()
		FlushChildHashtable(HY, h)
		SaveUnitHandle(HY, h, 17, u_1)
		SaveInteger(HY, h, 59, NCV)
		SaveInteger(HY, h, 60, NDV)
		SaveReal(HY, h, 0, 0.)
		TriggerRegisterDeathEvent(t, u_1)
		SaveTimerHandle(HY, h, 10, tt)
		TriggerRegisterTimerExpireEvent(t, tt)
		TriggerAddCondition(t, Condition(ref_function_NBV))
		SaveTriggerHandle(X, GetHandleId(u_1), 0 - NCV, t)
	end
	RemoveSavedBoolean(HY, h, 0)
	NKV = TimerGetRemaining(tt)
	if NKV < NJV then
		TimerStart(tt, NJV, false, nil)
	end
	t = nil
	tt = nil
	NIV(u_1, NCV, NAV)
	t = nil
	tt = nil
end

