function Detect_Injection ()
	local pOff1 = ReadMemory(pW3XGlobalClass) ---@type number integer
	if pOff1 > 0 then
		pOff1 = ReadMemory(pOff1 + 0x1C)
		if pOff1 > 0 then
			pOff1 = ReadMemory(pOff1 + 0xC)
			if pOff1 > 0 and ReadMemory(pOff1) ~= OriginWar3World then
				PatchMemory(pOff1, OriginWar3World)
			end
		end
	end
	if GetModuleHandle("KERNELBASE.dll") ~= 0 then
		KickForHacks(ReadByte(GetModuleProcAddress("KERNELBASE.dll", "GetTickCount")), "|c00ffff00CheatEngine SpeedHack Detected!|r")
	end
	if GetModuleHandle("Kernel32.dll") ~= 0 then
		KickForHacks(ReadByte(GetModuleProcAddress("Kernel32.dll", "GetTickCount")), "|c00ffff00CheatEngine SpeedHack Detected!|r")
	end
	if GetModuleHandle("basic.dll") ~= 0 then
		KickForHacks(0xE9, "|c00ffff00Garena Master / ZodCraft DETECTED!|r")
	end
	if GetModuleHandle("Reverb2.flt") ~= 0 then
		KickForHacks(0xE9, "|c00ffff00W3SH Hack DETECTED!|r")
	end
	if GetModuleHandle("clock.tmp") ~= 0 then
		KickForHacks(0xE9, "|c00ffff00RGC Hack DETECTED!|r")
	end
	if GetModuleHandle("WS2_32.dll") ~= 0 then
		KickForHacks(ReadByte(GetModuleProcAddress("WS2_32.dll", "send")), "|c00ffff00Custom SpeedHack Detected!|r")
	end
