function Results_findSenders ()
	local totalPlayers = 0 ---@type number integer
	local i_1 = 0 ---@type number integer
	local p ---@type player
	local potentialSenders ---@type player
	local pidx ---@type number integer
	while(true) do
		if (i_1 > 7) then break end
		p = Player(i_1)
		if player_isIngame(p) then
			potentialSenders[totalPlayers] = p
			totalPlayers = totalPlayers + 1
		end
		i_1 = i_1 + 1
	end
	if totalPlayers == 0 then
		Results_senderOne = nil
		Results_senderTwo = nil
	elseif totalPlayers == 0 then
		Results_senderOne = potentialSenders[0]
		Results_senderTwo = nil
	else
		totalPlayers = totalPlayers - 1
		pidx = GetRandomInt(0, totalPlayers)
		Results_senderOne = potentialSenders[pidx]
		potentialSenders[pidx] = potentialSenders[totalPlayers]
		totalPlayers = totalPlayers - 1
		pidx = GetRandomInt(0, totalPlayers)
		Results_senderTwo = potentialSenders[pidx]
	end
	p = nil
end

---@param this gamecache
---@param missionKey string
---@param key string
---@param value number integer
function gamecache_saveInt (this, missionKey, key, value)
	StoreInteger(this, missionKey, key, value)
end

---@param this gamecache
---@param missionKey string
---@param key string
function gamecache_syncInt (this, missionKey, key)
	SyncStoredInteger(this, missionKey, key)
end

function Results_send ()
	gamecache_saveInt(Results_cache, "EOG", "Win1", Results_data)
	gamecache_saveInt(Results_cache, "EOG", "Win2", Results_data)
	if Results_senderOne == nil or Results_senderTwo == nil or not player_isIngame(Results_senderOne) or not player_isIngame(Results_senderTwo) then
		Results_findSenders()
	end
	if Results_senderOne == GetLocalPlayer() then
		gamecache_syncInt(Results_cache, "EOG", "Win1")
	end
	if Results_senderTwo == GetLocalPlayer() then
		gamecache_syncInt(Results_cache, "EOG", "Win1")
	end
end

---@param pid number integer
function Results_set (pid)
	local rez = 1 ---@type number integer
	local i_1 = pid ---@type number integer
	while(true) do
		if (i_1 < 1) then break end
		rez = rez * 2
		i_1 = i_1 - 1
	end
	Results_data = Results_data + rez
end

function sendResults ()
	local i_1 = 0 ---@type number integer
	local p ---@type player
	local pid ---@type number integer
	local totalTime ---@type number integer
	while(true) do
		if (i_1 > 12) then break end
		p = Player(i_1)
		pid = player_getId(p)
		totalTime = PR * 3600 + FN * 60 + GN
		if player_isIngame(p) or totalTime - Ladder_events_udg_PlayerTime[pid + 1] < 180 then
			if player_isAllyOf(p, HN) then
				Results_set(pid)
			end
		end
		i_1 = i_1 + 1
	end
	p = nil
end

