---@param teamStart number integer
---@param teamEnd number integer
---@return number integer
function CountActivePlayersInTeam (teamStart, teamEnd)
	local countt = 0 ---@type number integer
	local it ---@type number integer
	while(true) do
		if (teamStart > teamEnd) then break end
		it = teamStart
		if IsPlayerInForce(Player(it), ZI) then
			countt = countt + 1
		end
		teamStart = teamStart + 1
	end
	return countt
end

---@param whichPlayer player
function SetObsMultiboard (whichPlayer)
	local playerId = GetPlayerId(whichPlayer) ---@type number integer
	local iObs = 3 ---@type number integer
	if IsPlayerObserver(whichPlayer) then
		if GetLocalPlayer() == whichPlayer then
			while(true) do
				if (iObs > 5) then break end
				MultiboardSetItemStyleBJ(JR, 6, CountPlayersInForceBJ(YI) + iObs, true, false)
				MultiboardSetItemWidthBJ(JR, 6, CountPlayersInForceBJ(YI) + iObs, 1)
				MultiboardSetItemValueBJ(JR, 6, CountPlayersInForceBJ(YI) + iObs, " ")
				MultiboardSetItemStyleBJ(JR, 7, CountPlayersInForceBJ(YI) + iObs, false, false)
				MultiboardSetItemStyleBJ(JR, 8, CountPlayersInForceBJ(YI) + iObs, false, false)
				MultiboardSetItemStyleBJ(JR, 9, CountPlayersInForceBJ(YI) + iObs, false, false)
				MultiboardSetItemStyleBJ(JR, 10, CountPlayersInForceBJ(YI) + iObs, false, false)
				MultiboardSetItemStyleBJ(JR, 11, CountPlayersInForceBJ(YI) + iObs, false, false)
				iObs = iObs + 1
			end
		end
	end
end

---@param whichPlayer player
function UpdateMultiboardForPlayer (whichPlayer)
	local playerId = GetPlayerId(whichPlayer) ---@type number integer
	local allyId ---@type number integer
	local row = 0 ---@type number integer
	local resourceString ---@type string
	local rowStart = 0 ---@type number integer
	local rowEnd = 4 ---@type number integer
	local teamStart = 0 ---@type number integer
	local teamEnd = 3 ---@type number integer
	if GetLocalPlayer() == whichPlayer then
		if playerId >= 4 then
			teamStart = 4
			teamEnd = 7
		end
		while(true) do
			allyId = teamStart + row
			if (allyId > teamEnd) then break end
			if playerId == allyId then
			else
				if IsPlayerAlly(Player(allyId), whichPlayer) then
					resourceString = PlayesrResoureses[allyId]
					if rowStart < rowEnd then
						MultiboardSetItemStyleBJ(JR, 6, CountPlayersInForceBJ(YI) + 3 + rowStart, true, false)
						MultiboardSetItemWidthBJ(JR, 6, CountPlayersInForceBJ(YI) + 3 + rowStart, 8)
						MultiboardSetItemValueBJ(JR, 6, CountPlayersInForceBJ(YI) + 3 + rowStart, GetPlayerColorString(allyId) .. "■ |r" .. resourceString)
						MultiboardSetItemStyleBJ(JR, 7, CountPlayersInForceBJ(YI) + 3 + rowStart, false, false)
						MultiboardSetItemStyleBJ(JR, 8, CountPlayersInForceBJ(YI) + 3 + rowStart, false, false)
						MultiboardSetItemStyleBJ(JR, 9, CountPlayersInForceBJ(YI) + 3 + rowStart, false, false)
						MultiboardSetItemStyleBJ(JR, 10, CountPlayersInForceBJ(YI) + 3 + rowStart, false, false)
						MultiboardSetItemStyleBJ(JR, 11, CountPlayersInForceBJ(YI) + 3 + rowStart, false, false)
					end
				end
				rowStart = rowStart + 1
			end
			row = row + 1
		end
	end
end

function UpdateAllPlayersMultiboards ()
	local ir = 0 ---@type number integer
	while(true) do
		if (ir > 11) then break end
		if ir == 8 or ir == 9 then
		elseif ir == 8 or ir == 9 then
			SetObsMultiboard(Player(ir))
		else
			UpdateMultiboardForPlayer(Player(ir))
		end
		ir = ir + 1
	end
end

---@param whichPlayer player
function ToggleMultiboardForPlayer (whichPlayer)
	local playerId = GetPlayerId(whichPlayer) ---@type number integer
	isMultiboardVisible[playerId] = not isMultiboardVisible[playerId]
	if GetLocalPlayer() == whichPlayer then
		MultiboardDisplay(JR, isMultiboardVisible[playerId])
	end
end

function ToggleMultiboardAction ()
	ToggleMultiboardForPlayer(GetTriggerPlayer())
end

function InitTrig_ToggleMultiboard ()
	local trg = CreateTrigger() ---@type trigger
	local itrg = 0 ---@type number integer
	while(true) do
		TriggerRegisterPlayerKeyEventBJ(trg, Player(itrg), bj_KEYEVENTTYPE_DEPRESS, bj_KEYEVENTKEY_DOWN)
		itrg = itrg + 1
		if (itrg >= bj_MAX_PLAYERS) then break end
	end
	TriggerAddAction(trg, ToggleMultiboardAction)
	trg = nil
end

function UpdateLumberTotals ()
	local pliterator = 0 ---@type number integer
	local pl ---@type player
	local plid ---@type number integer
	ExecuteFunc("SetPlayerResoureses")
	ExecuteFunc("UpdateAllPlayersMultiboards")
	lumberTotalGroup1 = 0
	lumberTotalGroup2 = 0
	while(true) do
		pl = Player(pliterator)
		if (pliterator >= 8) then break end
		if IsPlayerAlly(pl, Player(0)) or IsPlayerAlly(pl, Player(1)) or IsPlayerAlly(pl, Player(2)) or IsPlayerAlly(pl, Player(3)) and IsPlayerInForce(pl, ZI) then
			lumberTotalGroup1 = lumberTotalGroup1 + GetPlayerState(pl, PLAYER_STATE_RESOURCE_LUMBER)
		elseif IsPlayerAlly(pl, Player(0)) or IsPlayerAlly(pl, Player(1)) or IsPlayerAlly(pl, Player(2)) or IsPlayerAlly(pl, Player(3)) and IsPlayerInForce(pl, ZI) then
			lumberTotalGroup2 = lumberTotalGroup2 + GetPlayerState(pl, PLAYER_STATE_RESOURCE_LUMBER)
		end
		pliterator = pliterator + 1
	end
	pl = GetLocalPlayer()
	plid = GetPlayerId(pl)
	if IsPlayerAlly(pl, Player(0)) or IsPlayerAlly(pl, Player(1)) or IsPlayerAlly(pl, Player(2)) or IsPlayerAlly(pl, Player(3)) then
		MultiboardSetItemValueBJ(JR, 3, CountPlayersInForceBJ(YI) + 4, "|c00FAD214" .. I2S(lumberTotalGroup1))
		MultiboardSetItemValueBJ(JR, 3, CountPlayersInForceBJ(YI) + 5, "?")
	elseif IsPlayerAlly(pl, Player(0)) or IsPlayerAlly(pl, Player(1)) or IsPlayerAlly(pl, Player(2)) or IsPlayerAlly(pl, Player(3)) then
		MultiboardSetItemValueBJ(JR, 3, CountPlayersInForceBJ(YI) + 4, "?")
		MultiboardSetItemValueBJ(JR, 3, CountPlayersInForceBJ(YI) + 5, "|c00FAD214" .. I2S(lumberTotalGroup2))
	end
end

function InitTrig_UpdateLumberTotals ()
	local updateMultiboardTrigger = CreateTrigger() ---@type trigger
	TriggerRegisterTimerEventPeriodic(updateMultiboardTrigger, 1.0)
	TriggerAddAction(updateMultiboardTrigger, UpdateLumberTotals)
	updateMultiboardTrigger = nil
end

function SetPlayerResoureses ()
