		PlStats = "|cffFFcc00" .. I2S(GetPlayerState(pl, PLAYER_STATE_RESOURCE_GOLD)) .. "|cFFFFFFFF/" .. "|cffa6ef13" .. I2S(GetPlayerState(pl, PLAYER_STATE_RESOURCE_LUMBER)) .. "|cFFFFFFFF/" .. "|cffff0055" .. I2S(GetPlayerState(pl, PLAYER_STATE_RESOURCE_FOOD_USED)) .. "/|cffff0055" .. I2S(GetPlayerState(pl, PLAYER_STATE_RESOURCE_FOOD_CAP))
		PlayesrResoureses[itr] = PlStats
		itr = itr + 1
		if (itr >= bj_MAX_PLAYERS) then break end
	end
end

