function UpdateMaxUnits ()
	local currentWestUnits = CountUnitsInGroup(MA[1]) ---@type number integer
	local currentEastUnits = CountUnitsInGroup(MA[2]) ---@type number integer
	if currentWestUnits > maxWestUnits then
		maxWestUnits = currentWestUnits
	end
	if currentEastUnits > maxEastUnits then
		maxEastUnits = currentEastUnits
	end
end

function ClearTrashTextag ()
	local TPl = GetPlayerId(GetLocalPlayer()) ---@type number integer
	local i = 0 ---@type number integer
	local tag ---@type texttag
	while(true) do
		if (i >= 1000) then break end
		if LoadStr(unitDataHash, TPl, i) ~= "" then
			SaveStr(unitDataHash, TPl, i, "")
			SaveInteger(unitDataHash, TPl, 1000 + i, 0)
		end
		i = i + 1
	end
	i = 0
	while(true) do
		if (i >= 10) then break end
		tag = LoadTextTagHandle(textTagHash, TPl, i)
		if tag ~= nil then
			SetTextTagText(tag, "", 0.03)
			SaveTextTagHandle(textTagHash, TPl, i, nil)
			DestroyTextTag(tag)
		end
		i = i + 1
	end
end

function CreateUnitTableInRect ()
	local unitGroup = CreateGroup() ---@type group
	local u ---@type unit
	local i = 0 ---@type number integer
	local j = 0 ---@type number integer
	local columnIndex = 0 ---@type number integer
	local rowIndex = 0 ---@type number integer
	local unitName ---@type string
	local found ---@type boolean
	local coordX_QE ---@type number real
	local coordY_QE ---@type number real
	local tableText = "" ---@type string
	local coorx ---@type number real
	local textSize = 0.03 ---@type number real
	local columnSpacing = 420 ---@type number real
	local maxRowsPerColumn = 6 ---@type number integer
	local pl = GetLocalPlayer() ---@type player
	local f ---@type force
	local f2 ---@type force
	local trashRect ---@type rect
	local playerId = GetPlayerId(pl) ---@type number integer
	if playerId / 4 == 1 then
		f = WestForce
		f2 = EastForceWithoutObs
		coordX_QE = 2030
		coordY_QE = -3000
		trashRect = IK
	else
		f = EastForce
		f2 = WestForceWithoutObs
		coordX_QE = -2200
		coordY_QE = -3000
		trashRect = RK
	end
	GroupClear(unitGroup)
	GroupEnumUnitsInRect(unitGroup, trashRect, nil)
	j = 0
	while(true) do
		if (j >= i) then break end
		SaveStr(unitDataHash, playerId, j, "")
		SaveInteger(unitDataHash, playerId, 1000 + j, 0)
		j = j + 1
	end
	i = 0
	while(true) do
		u = FirstOfGroup(unitGroup)
		if (u == nil) then break end
		GroupRemoveUnit(unitGroup, u)
		unitName = GetUnitName(u)
		found = false
		while(true) do
			if (j >= i) then break end
			if LoadStr(unitDataHash, playerId, j) == unitName then
				SaveInteger(unitDataHash, playerId, 1000 + j, LoadInteger(unitDataHash, playerId, 1000 + j) + 1)
				found = true
				if (true) then break end
			end
			j = j + 1
		end
		if not found then
			SaveStr(unitDataHash, playerId, i, unitName)
			SaveInteger(unitDataHash, playerId, 1000 + i, 1)
			i = i + 1
		end
		j = 0
	end
	j = 0
	columnIndex = 0
	rowIndex = 0
	while(true) do
		if (j >= i) then break end
		tableText = tableText .. LoadStr(unitDataHash, playerId, j) .. " |cfffffc01" .. I2S(LoadInteger(unitDataHash, playerId, 1000 + j)) .. "|r\n"
		rowIndex = rowIndex + 1
		if playerId / 4 == 1 then
			coorx = coordX_QE + (columnIndex * columnSpacing)
		else
			coorx = coordX_QE - (columnIndex * columnSpacing)
		end
		if LoadTextTagHandle(textTagHash, playerId, columnIndex) == nil then
			SaveTextTagHandle(textTagHash, playerId, columnIndex, CreateTextTag())
			ShowTextTagForceBJ(true, LoadTextTagHandle(textTagHash, playerId, columnIndex), f)
			ShowTextTagForceBJ(false, LoadTextTagHandle(textTagHash, playerId, columnIndex), f2)
			SetTextTagVisibility(LoadTextTagHandle(textTagHash, playerId, columnIndex), true)
		end
		SetTextTagText(LoadTextTagHandle(textTagHash, playerId, columnIndex), tableText, textSize)
		SetTextTagPos(LoadTextTagHandle(textTagHash, playerId, columnIndex), coorx, coordY_QE, 0)
		SetTextTagPermanentBJ(LoadTextTagHandle(textTagHash, playerId, columnIndex), true)
		if rowIndex > maxRowsPerColumn then
			columnIndex = columnIndex + 1
			rowIndex = 0
			tableText = ""
		end
		j = j + 1
	end
	if tableText ~= "" then
		SetTextTagText(LoadTextTagHandle(textTagHash, playerId, columnIndex), tableText, textSize)
		SetTextTagPos(LoadTextTagHandle(textTagHash, playerId, columnIndex), coorx, coordY_QE, 0)
		SetTextTagPermanentBJ(LoadTextTagHandle(textTagHash, playerId, columnIndex), true)
		ShowTextTagForceBJ(true, LoadTextTagHandle(textTagHash, playerId, columnIndex), f)
		ShowTextTagForceBJ(false, LoadTextTagHandle(textTagHash, playerId, columnIndex), f2)
		SetTextTagVisibility(LoadTextTagHandle(textTagHash, playerId, columnIndex), true)
	end
	DestroyGroup(unitGroup)
	u = nil
end

function InitTrig_UnitTrashNameTable ()
	local trg = CreateTrigger() ---@type trigger
	TriggerRegisterTimerEvent(trg, 1.0, true)
	TriggerAddAction(trg, CreateUnitTableInRect)
	trg = nil
end

---@param unitrect rect
---@return number integer
function CountUnitsInTrashGroup (unitrect)
	local count = 0 ---@type number integer
	local u = nil ---@type unit
	local unitGroup = CreateGroup() ---@type group
	GroupClear(unitGroup)
	GroupEnumUnitsInRect(unitGroup, unitrect, nil)
	while(true) do
		u = FirstOfGroup(unitGroup)
		if (u == nil) then break end
		count = count + 1
		GroupRemoveUnit(unitGroup, u)
	end
	DestroyGroup(unitGroup)
	unitGroup = nil
	u = nil
	return count
end

function UpdateGameTime ()
	local timeString ---@type string
	if PR > 0 then
		timeString = I2S(PR) .. ":"
	else
		timeString = ""
	end
	timeString = timeString .. MR .. ":" .. LR
	gameTimerString = "Time (" .. timeString .. ")"
	MultiboardSetTitleText(JR, IR .. "|cffFF0000 (" .. LN .. ") |r" .. gameTimerString)
	westUnitsInTrash = CountUnitsInTrashGroup(RK)
	eastUnitsInTrash = CountUnitsInTrashGroup(IK)
end

function StartGameTimerForMap ()
	TimerStart(gameTimer, 1.0, true, UpdateGameTime)
end

